import React from 'react'
import { Box,Text } from 'grommet'

export default function ReporterProfile() {
    
    const u=sessionStorage.getItem('user');
    const id=JSON.parse(u).id;
  const retrieveNews = () => {
    NewsDataService.getAll()
      .then((response) => {
        setNews(response.data);
      })
      .catch((err) => {
        if (err) {
          console.log(err);
        }
      });
  };
    return (
       <Box>
           <Text></Text>
       </Box>
    )
}
